import React from 'react';
import styles from './Header.module.css';
import { Link } from 'react-router-dom';

export default function Header() {
  return (
    <div>
    <header className={styles.container}>
      <div><h1 >Movie Recommender</h1></div>
      <div><li>{globalThis.userName === null || globalThis.userName === undefined ?
      <Link to="/Login">Login/Register</Link> : <Link to="/Profile">Profile</Link>}</li></div>
    </header>
  </div>
  );
}
